//doc.rust-lang.org/1.81.0/std/primitive.usize.html\">usize</a>&gt; <a class=\"trait\" href=\"https://doc.rust-lang.org/1.81.0/core/convert/trait.TryFrom.html\" title=\"trait core::convert::TryFrom\">TryFrom</a>&lt;&amp;mut <a class=\"primitive\" href=\"https://doc.rust-lang.org/1.81.0/std/primitive.slice.html\">[T]</a>&gt; for <a class=\"primitive\" href=\"https://doc.rust-lang.org/1.81.0/std/primitive.array.html\">[T; N]</a><div class=\"where\">where\n    T: <a class=\"trait\" href=\"https://doc.rust-lang.org/1.81.0/core/marker/trait.Copy.html\" title=\"trait core::marker::Copy\">Copy</a>,</div></h3></section></summary><div class=\"docblock\"><p>Tries to create an array <code>[T; N]</code> by copying from a mutable slice <code>&amp;mut [T]</code>.\nSucceeds if <code>slice.len() == N</code>.</p>\n\n<div class=\"example-wrap\"><pre class=\"rust rust-example-rendered\"><code><span class=\"kw\">let </span><span class=\"kw-2\">mut </span>bytes: [u8; <span class=\"number\">3</span>] = [<span class=\"number\">1</span>, <span class=\"number\">0</span>, <span class=\"number\">2</span>];\n\n<span class=\"kw\">let </span>bytes_head: [u8; <span class=\"number\">2</span>] = &lt;[u8; <span class=\"number\">2</span>]&gt;::try_from(<span class=\"kw-2\">&amp;mut </span>bytes[<span class=\"number\">0</span>..<span class=\"number\">2</span>]).unwrap();\n<span class=\"macro\">assert_eq!</span>(<span class=\"number\">1</span>, u16::from_le_bytes(bytes_head));\n\n<span class=\"kw\">let </span>bytes_tail: [u8; <span class=\"number\">2</span>] = (<span class=\"kw-2\">&amp;mut </span>bytes[<span class=\"number\">1</span>..<span class=\"number\">3</span>]).try_into().unwrap();\n<span class=\"macro\">assert_eq!</span>(<span class=\"number\">512</span>, u16::from_le_bytes(bytes_tail));</code></pre></div>\n</div><div class=\"impl-items\"><details class=\"toggle\" open><summary><section id=\"associatedtype.Error\" class=\"associatedtype trait-impl\"><a href=\"#associatedtype.Error\" class=\"an